import React, { useEffect } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { startGetWishlists } from '../Actions/wishlist'
import { Card } from 'react-bootstrap'

const WishlistItems = () => {
  const dispatch = useDispatch()
  const wishlistItems = useSelector(state => state.wishlist.data)
  console.log(wishlistItems)

  useEffect(() => {
    dispatch(startGetWishlists())
  }, [dispatch])

  return (
    <div>
      <div className="row">
        {wishlistItems.map(ele => (
          <div key={ele.id} className="col-md-4 mb-4">
            <Card>
              <Card.Body>
                {ele.images.map((images, index) => (
                  <div key={index}>
                    <img src={`http://localhost:3009/${ele.images}`} alt={`Image ${index}`} style={{ width: '100%', marginBottom: '10px' }} />
                  </div>
                ))}
                <Card.Title>{ele.caption}</Card.Title>
                <Card.Text>
                  Price: {ele.price}
                </Card.Text>
              </Card.Body>
            </Card>
          </div>
        ))}
      </div>
    </div>
  )
}

export default WishlistItems
